    var heatLayer = L.heatLayer([], { radius: 20 }).addTo(map);

    // Extract properties from the GeoJSON features and populate the select element
    var parameterSelect = document.getElementById('parameter-select');
    var properties = Object.keys(geojson.features[0].properties);
    properties.forEach(function(property) {
        var option = document.createElement('option');
        option.value = property;
        option.textContent = property;
        parameterSelect.appendChild(option);
    });

    // Update heatmap when parameter selection changes
    parameterSelect.addEventListener('change', function() {
        var selectedParameter = this.value;
        updateHeatmap(selectedParameter);
    });

    // Initial update with default parameter
    updateHeatmap(properties[0]); // Use the first property as default

    function updateHeatmap(parameter) {
        heatLayer.setLatLngs([]); // Clear previous heatmap data
        geojson.features.forEach(function(feature) {
            var lat = feature.geometry.coordinates[0][0][1];
            var lng = feature.geometry.coordinates[0][0][0];
            var value = feature.properties[parameter];
            if (!isNaN(value)) { // Check if value is a number
                heatLayer.addLatLng([lat, lng, value]);
            }
        });
    }
